import styled from "styled-components";

function Footer() {
  return (
    <Container>
      <Wrap>
        <ImgList>
          <Img01>
            <img className="cilcle_01" alt="circle_bg" src="/img/Ellipse5.png" ref={img01Ref} />
          </Img01>

          <Img02>
            <img className="cilcle_02" alt="circle_bg" src="/img/Ellipse6.png" ref={img02Ref} />
          </Img02>
          <Img03>
            <img className="cilcle_03" alt="circle_bg" src="/img/Ellipse9.png" ref={img03Ref} />
          </Img03>
          <Img04>
            <img className="cilcle_04" alt="circle_bg" src="/img/Ellipse8.png" ref={img04Ref} />
          </Img04>
        </ImgList>
        <TextBox>
          <p>Thank you for your time. </p>
        </TextBox>
      </Wrap>
    </Container>
  );
}

export default Footer;

const Container = styled.div`
  width: 100%;
  height: 25vw;

  margin: 0 auto;

  background: ${({ theme }) => theme.colors.green_color};
  position: relative;
`;
